import styled from 'styled-components'

export const StyledHeader = styled.nav`
ul {
    list-style-type :none;
    margin : 0;
    padding: 0;
  overflow: hidden;
  background-color: #333;

}
li {
    display: block;
  color: white;
  text-align: center;
  padding: 14px 16px;
  text-decoration: none;
  float: left;
}

`
